import React from 'react'
import { useHistory } from "react-router-dom";

import Illustration from '../../Assets/illutration.jpg'

const Login = () => {
    const history = useHistory()

    const Onlogin = () => {
        history.push('/home')
    }
    return (
        <div className='Login-container'>

            {/* <svg className='Blob' viewBox="0 0 200 200" xmlns="http://www.w3.org/2000/svg">
  <path fill="#2EE799" d="M53.4,-50.8C64.3,-42.6,64.7,-21.3,62.8,-1.9C60.9,17.4,56.6,34.9,45.7,43C34.9,51.1,17.4,49.8,-2.3,52.1C-22.1,54.5,-44.2,60.4,-53,52.3C-61.7,44.2,-57.2,22.1,-54.4,2.8C-51.7,-16.6,-50.7,-33.1,-41.9,-41.4C-33.1,-49.6,-16.6,-49.4,2.4,-51.8C21.3,-54.1,42.6,-59,53.4,-50.8Z" transform="translate(100 100)" />
</svg> */}
            <div className='left-box'>
                <img src={Illustration} alt='Illustration' draggable='false' />
            </div>
            <div className='right-box'>
                <h2>Login</h2>
                <input placeholder='Email' />
                <input placeholder='Password' />
                <button onClick={Onlogin}>Login</button>
            </div>
        </div>
    )
}

export default Login
